import NavBar from "./Components/NavBar";
import Feature from "./Components/Feature";
import Info from "./Components/Info";
import detail from "./InfoDetails";

function App() {


  return (
    <>
    <NavBar/>
    <Feature/>
    {detail.map(item=>{
       return <Info
       icon={item.icon}
       title={item.title}
       content={item.content}
       />
    })}

    </>
  );
}

export default App;
